window.bookSummaryJSON = "<p><b>Death isn't the end.</b></p> <p>Marie didn't expect to be given the opportunity to go to a new universe when she died, but when it was offered she held to the offer with all her might. </p> <p>Taking the name of Talyn, she was accompanied to the new world by the goddess Melody as her assistant, as she seeks out a more rewarding life for herself, no matter what challenges may stand before her. </p> <p>Even if the introduction of some game mechanics and a goddess to her life has unanticipated consequences.</p> <p>This is a slow-burn story, with more slice of life sections to it. While it is LitRPG, there are no attributes to speak of.</p>"; 
